func TestParseName(t *testing.T) {
	parsed1 := ParseName("Jie Yang")
	parsed2 := ParseName("Wilson, Kuston A.")
	parsed3 := ParseName("Wilson, Kuston")
	fmt.Printf("%v, %v, %v", parsed1, parsed2, parsed3)

}

func TestPostProcessPeople(t *testing.T) {
	type args struct {
		ctx context.Context
		m   PubSubMessage
	}
	v := args{
		m: PubSubMessage{
			Data: []byte(`json`),
		},
	}
	tests := []struct {
		name    string
		args    args
		wantErr bool
	}{
		{
			name:    "Test process",
			args:    v,
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if err := PostProcessPeople(tt.args.ctx, tt.args.m); (err != nil) != tt.wantErr {
				t.Errorf("PostProcessPeople() error = %v, wantErr %v", err, tt.wantErr)
			}
		})
	}
}

